// 虚拟卡片组件
class DCVirtualCard {
  /**
   * 构造函数，用于初始化对象实例。
   *
   * @param {Object} options - 配置选项对象，包含以下可选属性：
   *   @param {string} [options.virtualName='Virtual'] - 虚拟卡名称。
   *   @param {string} [options.virtualDesc='Virtual Card'] - 虚拟卡描述。
   *   @param {string} [options.logoUrl='https://assets.codepen.io/14762/airwallex-virtual.svg'] - 卡片标志的URL。
   *   @param {string} [options.cardNumber='6230 5678 0012 3456 828'] - 卡号，默认值为带空格格式的字符串。
   *   @param {string} [options.cardId='00211'] - 卡片ID。
   *   @param {string} [options.cardName='Mike Trilford'] - 持卡人姓名。
   *   @param {string} [options.silkLogoUrl='https://assets.codepen.io/14762/visa-virtual.svg'] - 卡片丝印标志的URL。
   *   @param {string} [options.theme='one'] - 卡片主题。
   *   @param {HTMLElement} [options.targetElement=document.body] - 卡片渲染的目标DOM元素。
   *
   * @returns {void} - 无返回值。
   */
  constructor(options) {
    this.options = {
      virtualName: 'Virtual',
      virtualDesc: 'Virtual Card',
      logoUrl: 'https://assets.codepen.io/14762/airwallex-virtual.svg',
      cardNumber: '6230 5678 0012 3456 828',
      cardId: '00211',
      cardName: 'Mike Trilford',
      silkLogoUrl: 'https://assets.codepen.io/14762/visa-virtual.svg',
      theme: 'one',
      targetElement: document.body,
      ...options
    };

    // 格式化 cardNumber，每 4 个字符插入一个空格
    if (this.options.cardNumber) {
      this.options.cardNumber = this.formatCardNumber(this.options.cardNumber);
    }

    // DOM元素缓存
    this.elements = {
      card: null,
      cardNumber: null
    };

    // 初始化状态管理，用于控制卡片的交互行为
    this.state = {
      isFlipped: false, // 卡片是否翻转
      isActive: true // 卡片是否处于激活状态
    };

    // 调用初始化方法，完成对象的初始设置
    this.init();
  }

  /**
   * 初始化函数，用于设置组件或模块的初始状态。
   * 该函数依次调用以下方法：
   * 1. injectStyles - 注入样式；
   * 2. render - 渲染内容；
   * 3. bindEvents - 绑定事件。
   *
   * @returns {void} 无返回值。
   */
  init() {
    // 调用 injectStyles 方法，注入必要的样式
    this.injectStyles();

    // 调用 render 方法，渲染组件或模块的内容
    this.render();

    // 调用 bindEvents 方法，绑定事件监听器
    this.bindEvents();
  }

  /**
   * 渲染函数，用于生成虚拟卡片的主结构并将其插入到目标 DOM 元素中。
   * 该函数执行以下步骤：
   * 1. 解构 `this.options` 对象以获取必要的配置参数；
   * 2. 创建一个 `div` 元素作为卡片容器，并设置其类名和 HTML 内容；
   * 3. 调用 `renderHeader` 和 `renderFooter` 方法分别渲染顶部和底部区域；
   * 4. 将格式化后的卡号插入到卡片中心区域；
   * 5. 将生成的卡片元素附加到 `targetElement` 中。
   *
   * @returns {void} 无返回值。
   */
  render() {
    // 解构 options 对象，提取所需属性
    const { cardNumber, virtualName, virtualDesc, theme } = this.options;
    // 创建卡片容器元素并设置其类名
    this.elements.card = document.createElement('div');
    this.elements.card.className = `dc-virtual-card digital ${theme}`;
    // 设置卡片的 HTML 结构，调用 renderHeader 和 renderFooter 方法渲染子模块
    this.elements.card.innerHTML = `
      <div class="card-top">
        ${this.renderHeader()} <!-- 渲染顶部区域 -->
      </div>
      <div class="card-center">
        <p class="card-number">${this.formatCardNumber(cardNumber)}</p><!-- 格式化并显示卡号 -->
      </div>
      <div class="card-bottom">
        ${this.renderFooter()} <!-- 渲染底部区域 -->
      </div>
    `;

    // 将生成的卡片元素插入到目标 DOM 元素中
    this.options.targetElement.appendChild(this.elements.card);
  }

  /**
   * 渲染顶部区域，包含卡片标志和发布者信息。
   * 返回一个 HTML 字符串，包含以下内容：
   * 1. 卡片标志图片；
   * 2. 虚拟卡名称和描述。
   *
   * @returns {string} 包含顶部区域 HTML 的字符串。
   */
  renderHeader() {
    return `
      <div class="card-logo">
        <img src="${this.options.logoUrl}" alt="Card logo"> <!-- 卡片标志图片 -->
      </div>
      <div class="card-publisher">
        <span class="card-virtual-name">${this.options.virtualName}</span>  <!-- 虚拟卡名称 -->
        <span class="card-virtual-desc">${this.options.virtualDesc}</span>  <!-- 虚拟卡描述 -->
      </div>
    `;
  }

  /**
   * 渲染底部区域，包含卡片持有人信息和支付系统标志。
   * 返回一个 HTML 字符串，包含以下内容：
   * 1. 卡片 ID 和持卡人姓名；
   * 2. 支付系统的丝印标志图片。
   *
   * @returns {string} 包含底部区域 HTML 的字符串。
   */
  renderFooter() {
    return `
      <div class="card-name">
        <p class="card-id">NO.${this.options.cardId}</p> <!-- 显示卡片ID -->
        <p class="card-name-text">${this.options.cardName}</p> <!-- 显示持卡人姓名 -->
      </div>
      <!-- 支付系统标志图片 -->
      <img class="card-silk-logo" src="${this.options.silkLogoUrl}" alt="Payment system logo">
    `;
  }

  /**
   * 样式注入方法，用于将虚拟卡片的样式动态注入到文档中。
   * 采用单例模式，确保样式仅注入一次。
   * 具体步骤如下：
   * 1. 检查是否已存在 ID 为 `virtual-card-styles` 的样式元素；
   * 2. 如果不存在，则创建一个新的 `style` 元素；
   * 3. 设置样式内容并将其插入到 `document.head` 中。
   *
   * @returns {void} 无返回值。
   */
  injectStyles() {
    // 检查是否已注入样式，避免重复注入
    if (!document.getElementById('virtual-card-styles')) {
      const style = document.createElement('style');
      style.id = 'virtual-card-styles';
      style.textContent = this.getCardStyles();
      document.head.appendChild(style);
    }
  }

  // 样式内容
  getCardStyles() {
    return `
      /* 虚拟卡片样式 */
      @keyframes cardAnimation {
        60% {
          background-size: 400px 268px;
          background-position-x: 60%;
          background-position-y: 60%;
        }
      }

      @keyframes cardGradient {
        0% { background-position: 0% 10%; }
        50% { background-position: 100% 91%; }
        100% { background-position: 0% 10%; }
      }

      .theme {
        display: grid;
        grid-template-columns: repeat(8, 1fr);
        width: 360px;
        gap: 12px;
        margin-bottom: 24px;
        margin-top: 16px;

        img {
          border-radius: 4px;
          width: 100%;
          height: auto;
          background: rgb(42, 41, 45);
          border: 1px solid rgba(0, 0, 0, .02);
        }
      }

      .card-top {
        display: flex;
        justify-content: flex-start;
        align-items: flex-start;
        z-index: 1;
      }

      .card-publisher{
        margin-left: 12px;
        display: flex;
        justify-content: flex-start;
        align-items: flex-start;
        flex-wrap: wrap;
        flex-direction: column;

        .card-virtual-name{
          font-size: 20px;
          text-transform: uppercase;
          letter-spacing: 1.5px;
          font-weight: 500;
        }

        .card-virtual-desc {
          font-size: 14px;
          text-transform: uppercase;
          letter-spacing: 1.5px;
          font-weight: 500;
        }
      }

      .card-logo{
        width: 42px;
        height: 42px;
        border-radius: 50%;
        // border: 1px solid rgb(251, 251, 251);

        img{
          display: block;
          width: 100%;
          height: 100%;
          border-radius: 50%;
          object-fit: content;
        }
      }

      .card-center {
        display: flex;
        justify-content: center;
        align-items: center;
        z-index: 1;
        margin-top: 20px;
        margin-bottom: 20px;

        .card-number {
          font-size: 20px;
          letter-spacing: 1.5px;
          font-weight: 700;
          text-shadow: 0 0px 8px rgba(0, 0, 0, .12);
          font-family: AxLLCircular, Helvetica, Arial, sans-serif;
          -webkit-font-smoothing: antialiased;
        }
      }

      .card-bottom {
        display: flex;
        justify-content: space-between;
        z-index: 1;
      }

      .card-name {
        display: grid;
        grid-gap: 8px;
        p {
          margin: 0;
          font-size: 18px;
          letter-spacing: 1.5px;
          text-shadow: 0 0px 8px rgba(0, 0, 0, .12);
          font-weight: 700;
          max-width: 232px;
          white-space: nowrap;
          overflow-x: hidden;
          overflow-y: hidden;
          text-overflow: ellipsis;
        }
        p:first-child {
          font-weight: 500;
          font-size: 12px;
          text-transform: uppercase;
        }
        p:last-child {
          max-width: 232px;
          white-space: nowrap;
          overflow-x: hidden;
          overflow-y: hidden;
          text-overflow: ellipsis;
        }
      }

      .card-silk-logo{
        display: block;
        width: 120px;
        height: auto;
        // border: 1px solid rgb(251, 251, 251);
        filter: drop-shadow(0px 1px 0px rgba(255, 255, 255, 0.3))
              drop-shadow(0 2px 16px rgba(0, 0, 0, 0.12))
              drop-shadow(0px 0px 12px rgba(255, 255, 255, 1));
      }

      .dc-virtual-card {
        color: white;
        background-color: rgb(42, 41, 45);
        border-radius: 10px;
        height: 228px;
        width: 360px;
        min-width: 311px;
        position: relative;
        box-sizing: border-box;
        padding: 18px 24px;
        display: grid;
        grid-template-rows: 1fr auto;
        font-family: AxLLCircular, Helvetica, Arial, sans-serif;
        -webkit-font-smoothing: antialiased;
        font-size: 14px;
        box-shadow: 0 0px 8px rgba(0, 0, 0, .12), 0 2px 16px rgba(0, 0, 0, .12),
          0 4px 20px rgba(0, 0, 0, .12), 0 12px 28px rgba(0, 0, 0, .12);
        color: rgb(255, 255, 255);

        &.digital {
          background-size: 360px 227px;
          animation-name: cardAnimation;
          animation-duration: 10s;
          animation-iteration-count: infinite;
          transform: translateZ(0);
          color: black;
          position: relative;

          &:before {
            content: "";
            width: 100%;
            height: 100%;
            box-shadow: 0 -1px 0 0 rgba(255, 255, 255, .9), 0 1px 0 0 rgba(0, 0, 0, .2);
            position: absolute;
            z-index: 1;
            border-radius: 10px;
          }

          &:after {
            content: "";
            width: 100%;
            height: 100%;
            border-radius: 10px;
            background: linear-gradient(
                120deg,
                rgba(255, 255, 255, .02) 30%,
                rgba(255, 255, 255, .25) 40%,
                rgba(255, 255, 255, .08) 40%
              ),
              linear-gradient(0deg, rgba(255, 255, 255, .2), rgba(255, 255, 255, .3));
            background-size: 150% 150%;
            animation: cardGradient 45s ease-in-out infinite;
            transform: translateZ(0);
            position: absolute;
          }

          &.one { background-image: url("data:image/jpeg;base64,"); }

          &.two { background-image: url("data:image/jpeg;base64,"); }

          &.three { background-image: url("data:image/jpeg;base64,"); }

          &.four { background-image: url("data:image/jpeg;base64,"); }

          &.five { background-image: url("data:image/jpeg;base64,"); }

          &.six { background-image: url("data:image/jpeg;base64,"); }

          &.seven { background-image: url("data:image/jpeg;base64,"); }

          &.eight { background-image: url("data:image/jpeg;base64,"); }

        .card-silk-logo {
          filter:
            drop-shadow(0px 1px 0px rgba(255, 255, 255, 0.3))
            drop-shadow(0 2px 16px rgba(0, 0, 0, 0.12))
            drop-shadow(0px 0px 12px rgba(255, 255, 255, 1));
        }

        transition: transform 0.6s;
        transform-style: preserve-3d;

        &.flipped {
          transform: rotateY(180deg);
        }
      }
    `;
  }

  /**
 * 绑定事件监听器，用于处理用户交互。
 * 1. 为卡号元素绑定点击事件，触发复制卡号功能；
 * 2. 为卡片容器绑定双击事件，触发卡片翻转功能。
 *
 * @returns {void} 无返回值。
 */
  bindEvents() {
    // 获取卡号元素并绑定点击事件
    this.elements.cardNumber = this.elements.card.querySelector('.card-number');
    this.elements.cardNumber.addEventListener('click', () => this.copyCardNumber());

    // 绑定双击事件以实现卡片翻转
    this.elements.card.addEventListener('dblclick', () => this.toggleCard());
  }

  /**
   * 切换卡片的翻转状态。
   * 通过修改 `isFlipped` 状态和添加/移除 `flipped` 类名来实现视觉效果。
   *
   * @returns {void} 无返回值。
   */
  toggleCard() {
    this.state.isFlipped = !this.state.isFlipped;
    this.elements.card.classList.toggle('flipped', this.state.isFlipped);
  }

  /**
 * 格式化卡号，每 4 个数字后插入一个空格。
 *
 * @param {string} number - 原始卡号字符串。
 * @returns {string} 格式化后的卡号字符串。
 */
  formatCardNumber(number) {
    return number.replace(/(\d{4})/g, '$1 ').trim(); // 每 4 位数字插入空格
  }

  /**
   * 复制卡号到剪贴板，支持现代和传统方法。
   * 1. 如果浏览器支持 `navigator.clipboard`，使用其进行复制；
   * 2. 否则，回退到传统方法（创建临时文本域）。
   *
   * @returns {void} 无返回值。
   */
  copyCardNumber() {
    // 去除卡号中的空格
    const text = this.options.cardNumber.replace(/\s/g, '');

    if (navigator.clipboard) {
      // 使用现代 API 复制
      navigator.clipboard.writeText(text)
        .then(() => this.showFeedback())// 成功时显示反馈
        .catch(err => this.handleCopyError(err));// 处理错误
    } else {
      // 回退到传统方法
      this.legacyCopy(text);
    }
  }

  /**
   * 使用传统方法复制卡号。
   * 通过创建一个隐藏的 `textarea` 元素，将卡号内容写入并执行复制命令。
   *
   * @param {string} text - 要复制的卡号文本。
   * @returns {void} 无返回值。
   */
  legacyCopy(text) {
    const textarea = document.createElement('textarea'); // 创建临时文本域
    textarea.value = text;
    document.body.appendChild(textarea); // 添加到 DOM
    textarea.select(); // 选中文本

    try {
      document.execCommand('copy'); // 执行复制命令
      this.showFeedback(); // 显示成功反馈
    } catch (err) {
      this.handleCopyError(err); // 处理错误
    } finally {
      document.body.removeChild(textarea); // 移除临时文本域
    }
  }

  /**
   * 显示复制成功的视觉反馈。
   * 在卡片上动态创建一个提示元素，并在 2 秒后移除。
   *
   * @returns {void} 无返回值。
   */
  showFeedback() {
    const feedback = document.createElement('div'); // 创建反馈元素
    feedback.className = 'copy-feedback';
    feedback.textContent = '✓ Copied!'; // 设置提示文本

    this.elements.card.appendChild(feedback); // 添加到卡片
    setTimeout(() => feedback.remove(), 2000); // 2 秒后移除
  }

  /**
   * 处理复制失败的情况。
   * 输出错误日志并提示用户手动复制卡号。
   *
   * @param {Error} err - 错误对象。
   * @returns {void} 无返回值。
   */
  handleCopyError(err) {
    console.error('Copy failed:', err); // 输出错误信息
    alert('Copy failed. Please manually select the card number.'); // 提示用户
  }

  /**
   * 销毁组件实例，清理事件监听器和 DOM 元素。
   * 1. 移除卡号点击事件监听器；
   * 2. 从 DOM 中移除卡片元素。
   *
   * @returns {void} 无返回值。
   */
  destroy() {
    this.elements.cardNumber.removeEventListener('click', this.copyCardNumber); // 清理事件监听器
    this.elements.card.remove(); // 移除卡片元素
  }
}

// 模块导出
if (typeof module !== 'undefined' && module.exports) {
  module.exports = DCVirtualCard;
} else {
  window.DC = window.DC || {};
  window.DC.VirtualCard = DCVirtualCard;
}